function Login() {

    return (
      <div className="Login">

          <div className="input-group">
              <label htmlFor="name">Name</label>
              <input type="name" name="name" placeholder="philip" />
            </div>
            <div className="input-group">
              <label htmlFor="ID">ID</label>
              <input type="ID" name="ID" placeholder="1"/>
            </div>

      </div>
    );
  }

  export default Login;
